const MortgageCalculator = () => {
  return (
    <div style={{ minHeight: "100vh", paddingTop: "80px", padding: "2rem" }}>
      <h1 style={{ color: "#fff", textAlign: "center" }}>Mortgage Calculator</h1>
      <p style={{ color: "#ccc", textAlign: "center" }}>Calculate your monthly mortgage payments.</p>
    </div>
  )
}

export default MortgageCalculator
